INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 2.1, 2, "2030/01/01 14:59:59", 100, "2024/10/31 12:00:00", 0.0, "ヤマト", -416.5, 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 5.68, 2, "2030/01/01 14:59:59", 101, "2024/10/31 12:00:00", 0.0, "ヤマト", -416.5, 4);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3001, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 0.0, 1, "2030/01/01 14:59:59", 102, "2024/10/31 12:00:00", 0.0, "ヤマト", -416.5, 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 0.0, 1, "2030/01/01 14:59:59", 100, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 0.0, 1, "2030/01/01 14:59:59", 101, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 8.53, 2, "2030/01/01 14:59:59", 102, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 5);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 5.67, 1, "2030/01/01 14:59:59", 103, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 7);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3002, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 0.0, 1, "2030/01/01 14:59:59", 104, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 1);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3004, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 0.0, 3, "2030/01/01 14:59:59", 300, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 3);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3005, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 0.0, 7, "2030/01/01 14:59:59", 301, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 7);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3003, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 4.4, 1, "2030/01/01 14:59:59", 200, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 2);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3003, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, 0.0, 7, "2030/01/01 14:59:59", 201, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 7);
INSERT INTO `v1_7d6033bdbf636fed03f43f8642a56ce9cb20e62ab4ce312658d3bdb467dedf59` VALUES (3003, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, 5.6, 2, "2030/01/01 14:59:59", 202, "2024/10/31 12:00:00", 0.0, "フブキ", -416.5, 1);
